INSERT INTO sqlab_metadata (name, value) VALUES
  ('activities', '{"0": {"kind": "exercises", "label": "Exercices", "activity_number": 0, "title": "Entraînement", "activity_pitch": "Qui pourrait croire qu''une simple liste d''entiers se prête à une grande variété de techniques SQL ? Manipulation de nombres (bien sûr) et de chaînes de caractères, expressions conditionnelles, jointures internes et externes, auto-jointures, sous-requêtes (corrélées ou non), conditions complexes, agrégations, regroupements, CTE (récursives ou non), cette série fait appel à de nombreuses notions fondamentales ou plus avancées.\\n\\nLa plupart de ces exercices demandent un très bon niveau de SQL. Cependant, les notions de théorie des nombres mobilisées restent du niveau lycée (opérateurs arithmétiques, diviseurs d''un nombre, décomposition en facteurs premiers).", "tasks": [{"access": "002", "reward": 10, "number": 1, "task_title": "Carrés parfaits", "columns": ["n"], "formula": "salt_002(sum(nn(hash)) OVER ()) AS token"}, {"access": "052", "reward": 10, "number": 2, "task_title": "Entiers palindromiques", "columns": ["n"], "formula": "salt_052(sum(nn(hash)) OVER ()) AS token"}, {"access": "043", "reward": 10, "number": 3, "task_title": "Nombres triangulaires", "columns": ["n"], "formula": "salt_043((0) + sum(nn(A.hash)) OVER ()) AS token", "tweak_javascript": "result[9]?.n ?? 7_531_148"}, {"access": "010", "reward": 10, "number": 4, "task_title": "Entiers automorphes", "columns": ["n"], "formula": "salt_010(sum(nn(hash)) OVER ()) AS token"}, {"access": "032", "reward": 10, "number": 5, "task_title": "Nombres bicarrés", "columns": ["n"], "formula": "salt_032((0) + sum(nn(A.hash) + nn(B.hash) + nn(C.hash)) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "033", "reward": 10, "number": 6, "task_title": "Nombres bicarrés", "columns": ["n"], "formula": "salt_033((0) + sum(nn(A.hash) + nn(B.hash)) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "081", "reward": 10, "number": 7, "task_title": "Nombres premiers", "columns": ["n"], "formula": "salt_081(sum(nn(A.hash)) OVER ()) AS token"}, {"access": "082", "reward": 10, "number": 8, "task_title": "Nombres premiers", "columns": ["n"], "formula": "salt_082(bit_xor(sum(nn(A.hash))) OVER ()) AS token"}, {"access": "062", "reward": 10, "number": 9, "task_title": "Nombres premiers", "columns": ["n", "divisors"], "formula": "salt_062(string_hash(''(0)'') + bit_xor(sum(nn(A.hash))) OVER ()) AS token", "tweak_javascript": "result[13]?.divisors ?? 7_531_148"}, {"access": "023", "reward": 10, "number": 10, "task_title": "Nombres abondants", "columns": ["n"], "formula": "salt_023((0) + bit_xor(sum(nn(A.hash) + nn(B.hash))) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "024", "reward": 10, "number": 11, "task_title": "Nombres abondants", "columns": ["n"], "formula": "salt_024((0) + sum(nn(A.hash)) OVER ()) AS token", "tweak_javascript": "result[5]?.[''n''] ?? 7_531_148"}, {"access": "037", "reward": 10, "number": 12, "task_title": "Entiers sans facteurs carrés", "columns": ["n"], "formula": "salt_037(sum(nn(hash)) OVER ()) AS token"}, {"access": "009", "reward": 10, "number": 13, "task_title": "Nombres de Kaprekar", "columns": ["n"], "formula": "salt_009(sum(nn(hash)) OVER ()) AS token"}, {"access": "019", "reward": 10, "number": 14, "task_title": "Suite de Fibonacci", "columns": ["n"], "formula": "salt_019(string_hash(''(0)'') + count(*) OVER ()) AS token", "tweak_javascript": "result.map(x => x?.n ?? '''').join(''.'') || ''7_531_148''"}, {"access": "039", "reward": 10, "number": 15, "task_title": "Nombres de Harshad", "columns": ["n"], "formula": "salt_039(sum(string_hash(''(0)'')) OVER ()) AS token", "tweak_javascript": "[result.length].concat(result.slice(0, 20).map(x => x.n)).join(''.'')"}, {"access": "088", "reward": 10, "number": 16, "task_title": "FizzBuzz", "columns": ["fizzbuzz"], "formula": "salt_088(string_hash(''(0)'') + sum(nn(hash)) OVER ()) AS token", "tweak_javascript": "(result.slice(8, 16).map(x => x?.fizzbuzz ?? '''').join(''.'') || '''').toLowerCase() || ''7_531_148''"}, {"access": "078", "reward": 10, "number": 17, "task_title": "Vendredis 13", "columns": ["day", "occurrences"], "formula": "salt_078(string_hash(''(0)'') + count(*) OVER ()) AS token", "tweak_javascript": "result.map(x => x?.occurrences ?? '''').join('' '') || ''7_531_148''"}, {"access": "047", "reward": 10, "number": 18, "task_title": "Chiffres romains", "columns": ["n", "roman"], "formula": "salt_047(sum(string_hash(''(0)'')) OVER ()) AS token", "tweak_javascript": "col.roman.slice(10).filter((_, n) => n % 43 === 0).map(x => x.roman).join(''.'')"}], "task_count": 18, "hint_count": 42, "toc": "<div class=''toc''><div class=''activity-pitch''><p>Qui pourrait croire qu''une simple liste d''entiers se prête à une grande variété de techniques SQL ? Manipulation de nombres (bien sûr) et de chaînes de caractères, expressions conditionnelles, jointures internes et externes, auto-jointures, sous-requêtes (corrélées ou non), conditions complexes, agrégations, regroupements, CTE (récursives ou non), cette série fait appel à de nombreuses notions fondamentales ou plus avancées.</p><p></p><p>La plupart de ces exercices demandent un très bon niveau de SQL. Cependant, les notions de théorie des nombres mobilisées restent du niveau lycée (opérateurs arithmétiques, diviseurs d''un nombre, décomposition en facteurs premiers).</p></div><div class=''section''><h3>Suites numériques.</h3><div class=''section-intro''><p>Filtrez une liste d''entiers pour la réduire aux premiers termes de suites célèbres.</p></div><div class=''task-group''><span class=''task-title''>Carrés parfaits. </span><span class=''task-numbers''>1.</span></div><div class=''task-group''><span class=''task-title''>Entiers palindromiques. </span><span class=''task-numbers''>2.</span></div><div class=''task-group''><span class=''task-title''>Nombres triangulaires. </span><span class=''task-numbers''>3.</span></div><div class=''task-group''><span class=''task-title''>Entiers automorphes. </span><span class=''task-numbers''>4.</span></div><div class=''task-group''><span class=''task-title''>Nombres bicarrés. </span><span class=''task-numbers''>5, 6.</span></div><div class=''task-group''><span class=''task-title''>Nombres premiers. </span><span class=''task-numbers''>7, 8, 9.</span></div><div class=''task-group''><span class=''task-title''>Nombres abondants. </span><span class=''task-numbers''>10, 11.</span></div><div class=''task-group''><span class=''task-title''>Entiers sans facteurs carrés. </span><span class=''task-numbers''>12.</span></div><div class=''task-group''><span class=''task-title''>Nombres de Kaprekar. </span><span class=''task-numbers''>13.</span></div><div class=''task-group''><span class=''task-title''>Suite de Fibonacci. </span><span class=''task-numbers''>14.</span></div><div class=''task-group''><span class=''task-title''>Nombres de Harshad. </span><span class=''task-numbers''>15.</span></div></div><div class=''section''><h3>Miscellanées.</h3><div class=''section-intro''><p>Dans ces exercices, la liste des 1001 premiers entiers est utilisé comme support de création de tables intéressantes ou amusantes.</p></div><div class=''task-group''><span class=''task-title''>FizzBuzz. </span><span class=''task-numbers''>16.</span></div><div class=''task-group''><span class=''task-title''>Vendredis 13. </span><span class=''task-numbers''>17.</span></div><div class=''task-group''><span class=''task-title''>Chiffres romains. </span><span class=''task-numbers''>18.</span></div></div></div></div>"}}'),
